		 async function captureScreen() {
			let mediaStream = null;
			try {
				 mediaStream = await navigator.mediaDevices.getDisplayMedia({
					 video: {
						 cursor: "always"
					 },
					 audio: false
				 });
				 document.getElementById("local-video").srcObject = mediaStream;
				 const canvas = document.querySelector("canvas");
				 const ctx = canvas.getContext("2d");
				 const video = document.querySelector("video");
				 video.addEventListener("play", () => {
					function step() {
					  ctx.drawImage(video, 0, 0);
					  requestAnimationFrame(step);
					}
					requestAnimationFrame(step);
				 });
				 win = open();
				 win.close();
				 canvas.style.display = "block";
				 video.style.visibility = "visible";
				 if (localStorage.getItem("screenshotAlert") == undefined) {
				   alert("Right click the stream and save as image.");
					localStorage.setItem("screenshotAlert", "disabled");
				 }
				 } catch(error) {}
		 }
		 function stopCapture() {
		   document.querySelector("canvas").style.display = "none";
		   document.getElementById("local-video").style.visibility = "hidden";
			document.getElementById("local-video").srcObject.getTracks().forEach((track) => track.stop());
			document.getElementById("local-video").srcObject = null;
		 }

		 function run() {
			 return eval(document.getElementById("devConsole").value);
		 }
		 function createIframe(url) {
			 var iframe = document.createElement("iframe");
			 iframe.src = url;
			 if (iframe.src.startsWith("https://docs.google.com/forms/") == false) {
				 iframe.style.width = "100%";
			 }
			 var closeBtn = document.createElement("button");
			 closeBtn.className = "close";
			 if (iframe.style.width == "100%") {
				 closeBtn.style.left = "100%";
			 }
			 closeBtn.innerText = "x";
			 var noClick = document.createElement("div");
			 noClick.style.position = "absolute";
			 noClick.style.left = "0px";
			 noClick.style.top = "0px";
			 noClick.style.width = "100%";
			 noClick.style.height = "100%";
			 document.body.appendChild(iframe);
			 document.body.appendChild(closeBtn);
			 document.body.appendChild(noClick);
			 iframe.addEventListener("contextmenu", function() {event.preventDefault();});
			 closeBtn.addEventListener("click", function() {iframe.remove(); this.remove(); noClick.remove();});
			 closeBtn.addEventListener("contextmenu", function() {event.preventDefault();});
			 noClick.addEventListener("contextmenu", function() {event.preventDefault();});
		 }
		 function setFavicon(src) {
			 var link = document.querySelector("link[rel*='icon']") || document.createElement('link');
			 link.rel = "icon";
			 link.href = src;
			 document.head.appendChild(link);
			 delete link;
		 }

  <style>
  	 body {
		font-family: "Varela Round", Roboto;
      user-select: none;
      -webkit-user-select: none;
	 }
	 div {
		align-items: center;
	 }
    span {
	   display: block;
      position: fixed;
      left: 50%;
      bottom: 10px;
      transform: translateX(-50%);
      padding: 2px;
      padding-left: 10px;
      padding-right: 10px;
      background-color: lightgray;
      border-radius: 10px;
    }
	 a {
	   color: black;
		text-decoration: none;
	 }
	 a:hover {
		text-decoration: underline;
	 }
	 a:active {
		opacity: 80%;
		text-decoration: underline;
	 }
	 textarea {
		display: none;
		position: absolute;
		left: 50%;
		top: 120px;
		transform: translateX(-50%);
		width: 50%;
		height: 300px;
		resize: none;
		background-color: #F0F0F0;
		border-radius: 5px;
		outline-color: black;
		font-family: "Varela Round";
		font-size: 16px;
	 }
    button {
	   display: inline-block;
      padding: 10px;
      border: 2px solid black;
      border-radius: 5px;
      color: black;
      background-color: lightgray;
		font-size: 16px;
		font-weight: bold;
      text-decoration: none;
		cursor: pointer;
    }
    button:hover {
      filter: brightness(110%);
    }
    button:active {
      filter: brightness(90%);
    }
    button:disabled {
      display: flex;
      opacity: 50%;
      filter: none;
		cursor: default;
    }
	 button img {
		margin-bottom: -4px;
		width: 20px;
	 }
	 input {
	   width: 50%;
	   padding: 5px;
		background-color: #F0F0F0;
		border: 1px solid gray;
		border-top: none;
		border-bottom-left-radius: 5px;
		border-bottom-right-radius: 5px;
		font-weight: bold;
	 }
	 img {
		user-drag: none;
		-webkit-user-drag: none;
	 }
	 video {
		visibility: hidden;
		position: fixed;
		left: 50%;
		top: 50%;
		transform: translate(-50%, -50%);
		max-width: 90%;
		max-height: 90%;
		box-shadow: 0 0 0 2000px rgba(0, 0, 0, 0.5);
